r = parseInt(r);
if (isNaN(r)) {
    alert("输入必须是整数");
    return;
}
if (r <= 0) {
    alert("处理数量必须大于0");
    return;
}
g5.count = r;
postExpress();

control.onUpdate:
if (text == "IDL") {
    ee.setText(sender, "<font color = '#d03030'>销售</font>");
} else if (text == "OFL") {
    ee.setText(sender, "<font color = '#30a030'>下架</font>");
} else if (text == "DEL") {
    ee.setText(sender, "删除");
} else {
    ee.setText(sender, text);
}

